import React from "react";
import "./App.css";
import { Homepage } from "./containers/homepage/index.jsx";
// import { Navbar } from "../../components/navbar";
import { BrowserRouter, Route, Link, Switch} from "react-router-dom";
import { MoreAboutSection } from "./containers/homepage/moreAboutSection.jsx";

function App(props) {
  return(
    <BrowserRouter>
      <Switch>
      <Route path="/">
          <Homepage/>
        </Route>
        <Route path="/about">
          <MoreAboutSection/>
        </Route>
        <Route path="/tutors">
          <MoreAboutSection/>
        </Route>
        <Route path="/courses">
          <MoreAboutSection/>
        </Route>
        <Route path="/contact">
          <MoreAboutSection/>
        </Route>
      </Switch>
      </BrowserRouter>
  );
}

export default App;
